import React from "react";
import "./style.css";
import { Images } from "./../../config/image";
function Component_Block_Last() {
  return (
    <div>
      <div style={{ paddingTop: "40px" }}>
        <div className="box-all">
          <div>
            <img
              src={Images.FACE_1}
              style={{
                width: "60px",
                height: "60px",
                borderRadius: "50%",
                position: "absolute",
                right: "75px",
                top: "-30px",
              }}
            />
          </div>
          <div
            style={{
              width: "80%",
              height: "auto",
              display: "flex",
              justifyContent: "center",
            }}
          >
            <div style={{ display: "flex" }}>
              <div className="content-host">
                Giao diện thân thiện và rất dễ sử dụng, nhiều tính năng hữu ích,
                phù hợp với mọi chủ trọ.
              </div>
              <div className="name-host">Bác Phạm Thị Cúc</div>
              <div className="function">Chủ trọ</div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
export default Component_Block_Last;
